# coding=utf-8
from django.template.defaulttags import register


@register.filter(name='dickey')
def key(d, key_name):
    return d.get(key_name)


@register.filter(name='default_if_none_img')
def default_img(img_base64):
    if len(img_base64) > 0:
        return img_base64
    else:
        return ""
